"Tālrunis ir atdzisis un atkal darbojas normāli.

Tālrunis var pārkarst, ja:
\u0009• tiek veiktas darbības, kas patērē daudz akumulatora enerģijas, piemēram, video skatīšanās, spēļu spēlēšana un navigācijas izmantošana;
\u0009• tiek lejupielādēti vai augšupielādēti lieli faili;
\u0009• tālrunis atrodas tiešos saules staros."

"Jūsu tālrunis bija pārkarsis un tika izslēgts. Tagad tas darbojas normāli.

Tālrunis var sakarst, ja:
\u0009• tiek izmantotas lietotnes, kas patērē daudz enerģijas (piem., spēles, video lietotnes vai navigācija);
\u0009• tiek lejupielādēti/augšupielādēti lieli faili;
\u0009• tālrunis tiek lietots augstā temperatūrā."
